// src/components/SlideNavbar.js
import React from 'react';
import { useLocation } from 'react-router-dom';
import '../styles/index.css'; // Certifique-se de que este caminho está correto

function SlideNavbar() {
  const location = useLocation();
  const queryParams = new URLSearchParams(location.search);

  const handleFormSubmit = (event) => {
    event.preventDefault();
    const formData = new FormData(event.target);
    const data = {
      txt: formData.get('txt'),
      email: formData.get('email'),
      pswd: formData.get('pswd'),
    };
    console.log(data); // Verifique os dados capturados
  };

  return (
    <div className="main">
      <input type="checkbox" id="chk" aria-hidden="true" />

      <div className="signup">
        <form onSubmit={handleFormSubmit}>
          <label htmlFor="chk" aria-hidden="true">Sign Up</label>
          <input type="text" name="txt" placeholder="Username" defaultValue={queryParams.get('txt')} required />
          <input type="email" name="email" placeholder="Email" defaultValue={queryParams.get('email')} required />
          <input type="password" name="pswd" placeholder="Password" defaultValue={queryParams.get('pswd')} required />
          <button type="submit">Sign Up</button>
        </form>
      </div>

      <div className="login">
        <form onSubmit={handleFormSubmit}>
          <label htmlFor="chk" aria-hidden="true">Login</label>
          <input type="email" name="email" placeholder="Email" defaultValue={queryParams.get('email')} required />
          <input type="password" name="pswd" placeholder="Password" defaultValue={queryParams.get('pswd')} required />
          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
}

export default SlideNavbar;
